import React, { Component } from 'react';
import './HexagonGallery.css';
import { HexGrid, Layout, Hexagon, Text, Pattern, Path, Hex } from 'react-hexgrid';

class HexagonGallery extends Component {
	render() {
		return(
			<HexGrid width={"100%"} height={800} viewBox="-40 -40 90 90">
				<Layout size={{ x: 10, y: 10 }} flat={true} spacing={1.1} origin={{ x: 0, y: 0 }}>
					<Hexagon q={0} r={0} s={0} fill="pat-1" />
					<Hexagon q={0} r={-1} s={1} fill="pat-1" />
					<Hexagon q={0} r={1} s={-1} fill="pat-1" />
					<Hexagon q={1} r={-1} s={1} fill="pat-1" />
					<Hexagon q={-1} r={-1} s={1} fill="pat-1" />
					<Hexagon q={1} r={0} s={0} fill="pat-1" />
					<Hexagon q={-1} r={1} s={0} fill="pat-1" />
					<Hexagon q={-1} r={0} s={0} fill="pat-1" />
					<Hexagon q={-2} r={1} s={0} fill="pat-1" />
					<Hexagon q={1} r={-2} s={2} fill="pat-1" />
					<Hexagon q={-2} r={0} s={1} fill="pat-1" />
					<Hexagon q={2} r={-1} s={1} fill="pat-1" />
					<Hexagon q={2} r={0} s={0} fill="pat-1" />
				</Layout>
				<Pattern id="pat-0" link="images/empty.png" />
				<Pattern id="pat-1" link="images/empty.png" />
				<Pattern id="pat-2" link="images/empty.png" />
				<Pattern id="pat-3" link="images/empty.png" />
				<Pattern id="pat-4" link="images/empty.png" />
				<Pattern id="pat-5" link="images/empty.png" />
				<Pattern id="pat-6" link="images/empty.png" />
			</HexGrid>
		);
  }
}

export { HexagonGallery };
